    'register_confirmation.776': '\u0924\u0941\u092E\u091A\u093E \u092A\u0930\u0935\u0932\u0940\u091A\u093E \u0936\u092C\u094D\u0926 \u092A\u0921\u0924\u093E\u0933\u0923\u093E\u0931\u094D\u092F\u093E\u0932\u093E \u0924\u0941\u092E\u094D\u0939\u0940 \u0928\u092E\u0942\u0926 \u0915\u0947\u0932\u0947\u0932\u093E \u092A\u0930\u0935\u0932\u0940\u091A\u093E \u0936\u092C\u094D\u0926 \u091C\u0941\u0933\u0935\u0924\u093E \u0906\u0932\u093E \u0928\u093E\u0939\u0940.',
