    'help.HowLongWillMyPostingAppearOnBrand_contentNew': '\u0938\u0927\u094D\u092F\u093E OLX \u0935\u0930\u0940\u0932 \u092A\u094B\u0938\u094D\u091F\u0940\u0902\u0917\u094D\u091C <<NUMBER>> \u0926\u093F\u0935\u0938\u093E\u0902\u0928\u0902\u0924\u0930 \u0938\u092E\u093E\u092A\u094D\u0924 \u0939\u094B\u0924\u093E\u0924. \u0924\u094D\u092F\u093E\u0928\u0902\u0924\u0930 \u0938\u0902\u0915\u0947\u0924\u0938\u094D\u0925\u0933\u093E\u0935\u0930\u0941\u0928 \u092A\u094B\u0938\u094D\u091F\u0940\u0902\u0917\u094D\u091C \u0915\u093E\u0922\u0932\u0940 \u091C\u093E\u0924\u0940\u0932. \u0924\u0941\u092E\u091A\u0940 \u0935\u0938\u094D\u0924\u0942 \u0935\u093F\u0915\u0932\u0940 \u0917\u0947\u0932\u094D\u092F\u093E\u0928\u0902\u0924\u0930 \u0938\u0902\u0915\u0947\u0924\u0938\u094D\u0925\u0933\u093E\u0935\u0930\u0941\u0928 \u091C\u093E\u0939\u093F\u0930\u093E\u0924\u0940 \u0915\u093E\u0922\u0923\u0947, \u0939\u0940 \u0924\u0941\u092E\u091A\u0940 \u091C\u092C\u093E\u092C\u0926\u093E\u0930\u0940 \u0906\u0939\u0947. \u0924\u0938\u0947 \u0928 \u0915\u0947\u0932\u094D\u092F\u093E\u0938, \u0938\u092E\u093E\u092A\u094D\u0924\u0940\u091A\u094D\u092F\u093E \u0924\u093E\u0930\u0916\u0947\u0928\u0902\u0924\u0930 \u0924\u094D\u092F\u093E \u091C\u093E\u0939\u093F\u0930\u093E\u0924\u0940 \u0906\u092A\u094B\u0906\u092A\u091A \u0915\u093E\u0922\u0932\u094D\u092F\u093E \u091C\u093E\u0924\u0940\u0932. \u091C\u0930 \u0924\u0941\u092E\u094D\u0939\u093E\u0932\u093E \u0924\u0941\u092E\u091A\u0940 \u0935\u0938\u094D\u0924\u0942 \u0905\u0926\u094D\u092F\u093E\u092A\u0939\u0940 \u0935\u093F\u0915\u093E\u092F\u091A\u0940 \u0905\u0938\u0947\u0932, \u0924\u0930 \u091C\u093E\u0939\u093F\u0930\u093E\u0924 \u0915\u093E\u0922\u0942\u0928 \u091F\u093E\u0915\u0932\u0940 \u0917\u0947\u0932\u094D\u092F\u093E\u0928\u0902\u0924\u0930 \u0924\u0941\u092E\u094D\u0939\u0940 \u0924\u0941\u092E\u091A\u0940 \u091C\u093E\u0939\u093F\u0930\u093E\u0924 \u092A\u0941\u0928\u094D\u0939\u093E \u0926\u0947\u090A \u0936\u0915\u0924\u093E.',
