    'help.WhatAreClassifieds_content': '\u0915\u094D\u0932\u093E\u0938\u093F\u092B\u093E\u0908\u0921 \u0938\u094D\u0935\u0930\u0941\u092A\u093E\u091A\u094D\u092F\u093E \u091C\u093E\u0939\u093F\u0930\u093E\u0924\u0940\u0902\u092E\u0927\u094D\u092F\u0947 \u091C\u0930\u0940 \u0935\u093F\u0915\u094D\u0930\u0947\u0924\u094D\u092F\u093E\u0928\u0947/\u0935\u093F\u0915\u094D\u0930\u0947\u0924\u0940\u0928\u0947 \u0915\u093F\u0902\u092E\u0924 \u0928\u092E\u0942\u0926 \u0915\u0947\u0932\u0940 \u0905\u0938\u0947\u0932 \u0924\u0930\u0940 \u0917\u094D\u0930\u093E\u0939\u0915 \u092C\u094B\u0932\u0923\u0940 \u0915\u0930\u0923\u094D\u092F\u093E\u0938\u093E\u0920\u0940 \u0935\u093F\u0915\u094D\u0930\u0947\u0924\u094D\u092F\u093E\u0936\u0940 \u0928\u0947\u0939\u0947\u092E\u0940 \u0938\u0902\u092A\u0930\u094D\u0915 \u0938\u093E\u0927\u0924\u0940\u0932.',
