    'about.FindEverything1': 'OLX \u0935\u0930 \u0924\u0941\u092E\u094D\u0939\u093E\u0932\u093E \u0938\u0930\u094D\u0935\u0915\u093E\u0939\u0940 \u092E\u094D\u0939\u0923\u091C\u0947 \u0905\u0917\u0926\u0940 \u0907\u0932\u0947\u0915\u094D\u091F\u094D\u0930\u0949\u0928\u093F\u0915 \u0935\u0938\u094D\u0924\u0942, \u092A\u093E\u0933\u0940\u0935 \u092A\u094D\u0930\u093E\u0923\u0940 \u0915\u093F\u0902\u0935\u093E \u0935\u093E\u0939\u0928\u093E\u0902\u092A\u093E\u0938\u0942\u0928 \u0938\u094D\u0925\u093E\u0935\u0930 \u092E\u093E\u0932\u092E\u0924\u094D\u0924\u093E \u0915\u093F\u0902\u0935\u093E \u0938\u0947\u0935\u093E\u0902\u092A\u0930\u094D\u092F\u0902\u0924 \u0915\u093E\u0939\u0940\u0939\u0940 \u092E\u093F\u0933\u0942 \u0936\u0915\u0924\u0947',
