    'about.ItsEasy': '\u0916\u0930\u0947\u0926\u0940 \u0906\u0923\u093F \u0935\u093F\u0915\u094D\u0930\u0940 \u0915\u0930\u0923\u0947 \u0938\u094B\u092A\u0947 \u0906\u0939\u0947 \u0906\u0923\u093F \u0924\u094D\u092F\u093E\u0938\u093E\u0920\u0940 \u0928\u094B\u0902\u0926\u0923\u0940 \u0915\u0930\u0923\u094D\u092F\u093E\u091A\u0940 \u0906\u0935\u0936\u094D\u092F\u0915\u0924\u093E \u0928\u093E\u0939\u0940. \u092B\u0915\u094D\u0924 \u090F\u0915 \u091B\u093E\u092F\u093E\u091A\u093F\u0924\u094D\u0930 \u0918\u0947\u090A\u0928, \u0935\u0930\u094D\u0923\u0928 \u0935 \u0938\u0902\u092A\u0930\u094D\u0915\u093E\u091A\u0947 \u0924\u092A\u0936\u0940\u0932 \u0928\u092E\u0942\u0926 \u0915\u0930\u0941\u0928 \u0924\u0941\u092E\u094D\u0939\u0940 \u091C\u093E\u0939\u093F\u0930\u093E\u0924 \u092A\u094B\u0938\u094D\u091F \u0915\u0930\u0941 \u0936\u0915\u0924\u093E. \u0924\u094D\u092F\u093E\u0928\u0902\u0924\u0930 \u092B\u0915\u094D\u0924 \u092A\u094D\u0930\u0924\u093F\u0938\u093E\u0926\u093E\u0902\u091A\u0940 \u0935\u093E\u091F \u092A\u0939\u093E',
